Create a new file called `snake.html` in your workspace folder and paste the following code into it:  
```html
<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8"><title>Snake Game</title>
<style>
  canvas{border:1px solid #000;background:#eee}
</style>
</head>
<body>
<canvas id="game" width="400" height="400"></canvas>
<script>
const canvas=document.getElementById('game'),ctx=canvas.getContext('2d');
const size=20,cols=canvas.width/size,rows=canvas.height/size;
let snake=[[10,10]],dir=[0,1],food=[15,15],score=0;

function draw(){
  ctx.fillStyle='#eee';ctx.fillRect(0,0,canvas.width,canvas.height);
  ctx.fillStyle='green';
  snake.forEach(p=>ctx.fillRect(p[0]*size,p[1]*size,size,size));
  ctx.fillStyle='red';ctx.fillRect(food[0]*size,food[1]*size,size,size);
}

function update(){
  const newHead=[snake[0][0]+dir[0],snake[0][1]+dir[1]];
  if(newHead[0]<0||newHead[0]>=cols||newHead[1]<0||newHead[1]>=rows||
     snake.some(p=>p[0]===newHead[0]&&p[1]===newHead[1])){alert('Game Over! Score: '+score);location.reload();}
  snake.unshift(newHead);
  if(newHead[0]===food[0]&&newHead[1]===food[1]){score++;placeFood();}else snake.pop();
}

function placeFood(){
  let x=Math.floor(Math.random()*cols),y=Math.floor(Math.random()*rows);
  while(snake.some(p=>p[0]===x&&p[1]===y)) {x=Math.floor(Math.random()*cols);y=Math.floor(Math.random()*rows);}
  food=[x,y];
}

document.addEventListener('keydown',e=>{
  if(e.key==='ArrowUp' && dir[1]!==1)dir=[0,-1];
  else if(e.key==='ArrowDown'&&dir[1]!==-1)dir=[0,1];
  else if(e.key==='ArrowLeft'&&dir[0]!==1)dir=[-1,0];
  else if(e.key==='ArrowRight'&&dir[0]!==-1)dir=[1,0];
});

setInterval(()=>{update();draw();},200);
</script>
</body>
</html>
```
Save the file, double‑click it to open in your browser, and use the arrow keys to play.
